import React from 'react';
import {connect} from 'react-redux';
import * as types from '../constants/actionTypes';

class Logout extends React.Component {

  componentWillMount() {
    this.props.dispatch({
      type: types.LOGOUT__REQUESTED
    })
  }

  render() {
    return null;
  }
}

export default connect()(Logout);
